import React, {useState} from 'react';
import { Form, Input, Button, Radio } from 'antd';

const FormularioCadastro = () => {

    const initialData = {
        bairro: '',
        bpm: '',
        cia:'',
        cidade:'',
        data: '',
        lat_lon: '',
        naturezal: '',
        num_rop: '',
        procedimento: '',
        qtde_arma_fogo_ap: '',
        qtde_droga_ap: '',
        qtde_municoes_ap: '',
        qtde_vitima:'',
        tipo:'',
        tipo_2: '',
        tipo_arma: ''
    }

    let {values, setValues} = useState(initialData)

    const layout = {
        labelCol: { span: 8 },
        wrapperCol: { span: 16 },
    };



    return (
        
        <Form
            {...layout}
            name="basic"
            initialValues={{ remember: true }}
        >
            <Form.Item
                label="Data Ocorr~encia"
                name="data"
                rules={[{ required: true, message: 'Insira a data da ocorrência!' }]}
            >
                <Input />
            </Form.Item>

        </Form>
    )
}

export default FormularioCadastro;
